//BANNER

.banner {
  height: 50vh;
  background: $secondary;
  width: 100%;

  @media (max-width: $max-l) {
    height: 30vh;
  }
}

.padding-main {
  @include padding-xl;
}

.banner-img {
  width: 100%;
  height: 100%;
  object-fit: cover;
}

//SUB BANNER
.categories {
  display: flex;
  justify-content: space-around;
  margin: 0.5rem 0;
  border-color: $blue-gray;
  border-style: none none none solid;
  border-width: 1px;

  & a {
    width: 17.5%;
    @include categories;
    border-color: $blue-gray;
    border-style: none solid none none;
    border-width: 1px;
  }
}

//SORTING
.filter-sort {
  padding: 1rem 2rem;
}

.filter-sort {
  @include paragraph-text;
  font-size: $font-xs;
  display: block;
  position: relative;
}
.filter-sort-list {
  @include paragraph-text;
  font-size: $font-xs;
  padding: 0 1rem;

  & li {
    list-style: none;
    padding: 0.1rem;
  }

  & label {
    @extend .filter-sort-list;
    padding-left: 0.5rem;
  }
}
.dropdown {
  visibility: hidden;
  opacity: 0;
  background: $white;
  position: absolute;
  padding: 1rem;
  left: 2rem;
  display: none;
  border: $border-black;
  z-index: 1;
}

.filter-sort:hover > .dropdown,
.filter-sort .dropdown:hover {
  visibility: visible;
  opacity: 1;
  @include flex;
}

//CATALOGUE
.catalogue-grid {
  @include grid;
}

.catalogue {
  display: flex;
  flex-direction: column;
  overflow: hidden;
  height: 21rem;
  position: relative;

  &-info {
    background: rgba(255, 255, 255, 0.8);
    bottom: -5.55rem;
    position: absolute;
    transition: all 0.3s ease-out;
    display: flex;
    flex-direction: column;

    & h5 {
      position: relative;
    }
  }
  & img {
    width: $max-width;
    height: 100%;
    object-fit: cover;
    position: relative;
  }

  & p {
    font-size: 0.8rem;
    line-height: 1.2rem;
    padding: 1rem;
    flex-grow: 1;
  }
}
.catalogue:hover > .catalogue-info {
  transform: translate3d(0, -5.55rem, 0);
  border: none;

  & h5 {
    border: none;
    background: transparent;
  }
}

.pagination {
  justify-content: $center;
  display: flex;
  padding: 1rem 0;

  & .dot {
    height: 1rem;
    width: 1rem;
    background-color: $white;
    border: $border-black;
    border-radius: 50%;
    margin: 0 0.2rem;

    &-active,
    &:hover {
      background-color: $blush;
    }
  }
}
